import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class TokenService {

  private _accessToken: string = '';
  private _refreshToken: string = '';

  setTokens(accessToken: string, refreshToken: string): void {
    this._accessToken = accessToken;
    this._refreshToken = refreshToken;
    localStorage.setItem('accessToken', this._accessToken);
    localStorage.setItem('refreshToken', this._refreshToken);
  }

  get accessToken(): string {
    return this._accessToken;
  }

  get refreshToken(): string {
    return this._refreshToken;
  }

  clearTokens(): void {
    localStorage.removeItem('accessToken');
    localStorage.removeItem('refreshToken');
  }
}

import {Injectable} from '@angular/core';
import {User} from "../../../models/user.model";
import {Auth} from "aws-amplify";
import {CognitoUser} from "amazon-cognito-identity-js";

@Injectable({
  providedIn: 'root'
})
export class CognitoService {

  public signIn(user: User): Promise<CognitoUser> {
    return Auth.signIn(user.email, user.password);
  }

  public confirmNewPassword(user: CognitoUser, password: string): Promise<CognitoUser> {
    return Auth.completeNewPassword(user, password);
  }

  public signOut(): Promise<any> {
    return Auth.signOut();
  }
}

import {Component, OnInit} from '@angular/core';
import {AbstractControl, FormBuilder, FormGroup, Validators} from "@angular/forms";
import {CognitoService} from "../../services/cognito.service";
import {TokenService} from "../../services/token.service";

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.scss']
})
export class LoginComponent implements OnInit {
  loginForm!: FormGroup;
  formSubmitted: boolean = false;
  errorMessage: string = '';

  constructor(
    private fb: FormBuilder,
    private tokenService: TokenService,
    private cognitoService: CognitoService,
  ) {
  }

  ngOnInit(): void {
    this.loginForm = this.fb.group({
      email: ['', [Validators.required]],
      password: ['', [Validators.required]]
    })
  }

  get usernameControlStatus(): string {
    const usernameControl: AbstractControl = this.loginForm.get('email')!;
    if ((usernameControl.touched && usernameControl.invalid) || (this.formSubmitted && usernameControl.invalid)) {
      return 'error';
    } else if (usernameControl.touched && usernameControl.valid) {
      return 'success'
    }
    return '';
  }

  get passwordControlStatus(): string {
    const passwordControl: AbstractControl = this.loginForm.get('password')!;
    if ((passwordControl.touched && passwordControl.invalid) || (this.formSubmitted && passwordControl.invalid)) {
      return 'error';
    } else if (passwordControl.touched && passwordControl.valid) {
      return 'success'
    }
    return '';
  }

  onSubmit() {
    this.formSubmitted = true;
    this.cognitoService.signIn(this.loginForm.getRawValue())
      .then(async (cognitoUser) => {
        console.log('sign in res: ', cognitoUser);
        if (cognitoUser.challengeName === 'NEW_PASSWORD_REQUIRED') {
          cognitoUser = await this.cognitoService.confirmNewPassword(cognitoUser, 'Quicksilva@7');
        }
        const accessToken: string = cognitoUser.getSignInUserSession()?.getAccessToken().getJwtToken() as string;
        const refreshToken: string = cognitoUser.getSignInUserSession()?.getRefreshToken().getToken() as string;
        this.tokenService.setTokens(accessToken, refreshToken);
      }).catch(
      () => this.errorMessage = 'Login failed. Please try again'
    );
  }

  logOut() {
    this.cognitoService.signOut()
      .then(() => {
        this.tokenService.clearTokens();
      });
  }
}
<div class="login-container">
  <div class="login-form">
    <form
      nz-form
      [formGroup]="loginForm"
      [nzLayout]="'vertical'"
    >
      <h2 class="login-title">Login</h2>

      <nz-form-item>
        <nz-form-label [nzFor]="'username'" nzRequired>Username</nz-form-label>
        <nz-form-control [nzValidateStatus]="usernameControlStatus" [nzErrorTip]="'Username is required!'"
                         nzHasFeedback>
          <input
            nz-input
            id="username"
            type="text"
            formControlName="email"
            placeholder="Enter your name"
          />
        </nz-form-control>
      </nz-form-item>

      <nz-form-item>
        <nz-form-label [nzFor]="'password'" nzRequired>Password</nz-form-label>
        <nz-form-control [nzValidateStatus]="passwordControlStatus" [nzErrorTip]="'Password is required!'"
                         nzHasFeedback>
          <input
            nz-input
            id="password"
            type="password"
            formControlName="password"
            placeholder="Enter your password"
          />
        </nz-form-control>
      </nz-form-item>

      <div class="form-actions">
        <button
          type="submit"
          (click)="onSubmit()"
          nz-button
          nzType="primary"
          [disabled]="loginForm.invalid && formSubmitted"
        >Login
        </button>
        <button
          (click)="logOut()"
          nz-button
          nzType="dashed"
        >logout
        </button>
      </div>

      <div class="error-message">
        {{ errorMessage }}
      </div>
    </form>
  </div>
</div>

